import { ColumnFilter } from "./ColumnFilter";

export const COLUMNS = [
    {
        Header: 'Артикуль',
        accessor: 'Артикуль'
        
    },
    {
        Header: 'Наименование',
        accessor: 'Наименование'
        
    },
    {
        Header: 'Группа товара',
        accessor: 'Группа_товара'
    },
    {
        Header: 'Поставщик',
        accessor: 'Поставщик'
    },
    {
        Header: 'Типоразмер',
        accessor: 'Типоразмер'
    },
    {
        Header: 'Модель',
        accessor: 'Модель'
    },
    {
        Header: 'Цена',
        accessor: 'Цена'
    },
    {
        Header: '',
    Cell: ({ row }) => (
      <Checkbox
        {...row.getToggleRowSelectedProps()}
        onClick={() => {
          row.toggleRowSelected();
        }}
      />
    ),
    width: '100px',
    }
]
